import * as React from "react"

export const Logo = (props) => (
  <svg
    {...props}
    xmlns="http://www.w3.org/2000/svg"
    xmlnsXlink="http://www.w3.org/1999/xlink"
    width={503.956}
    height={77.6}
    preserveAspectRatio="xMidYMid"
    style={{
      background: "0 0",
    }}
    viewBox="-1.978 36.2 503.956 77.6"
  >
    <defs>
      <filter id="a" width="300%" height="300%" x="-100%" y="-100%">
        <feFlood floodColor="red" result="color" />
        <feImage
          xlinkHref="data:image/svg+xml;base64,"
          width={2000}
          height={1000}
          x={0}
          y={0}
          result="image"
        />
        <feTile in="image" result="tile" />
        <feComposite in="SourceGraphic" in2="image" operator="in" />
      </filter>
    </defs>
    <g filter="url(#a)" />
  </svg>
)

export default Logo
